import "./side-menu.css";
import { icon } from "../../assets/icons.jsx";
function SideMenu() {
  return (
    <aside>
      <span className="menu-text">Menu</span>
      <ul>
        <li>
          <img src={icon} />
          <a href="#">Projects</a>
        </li>
        <li>
          <a href="#">My Tasks</a>
        </li>
        <li>
          <a href="#">Messages</a>
        </li>
        <li>
          <a href="#">Calendar</a>
        </li>
      </ul>
    </aside>
  );
}

export default SideMenu;
